import React, { useState } from 'react';

const CustomDock = () => {
    const [isTabVisible, setIsTabVisible] = useState(false);

    return (
        <div className='mx-auto min-h-screen flex flex-col items-center justify-center py-20 max-md:py-16 px-8 bg-gray-300'>
            <div className='flex gap-4 bg-gray-900 w-full rounded-t-2xl fixed -bottom-5 max-w-[1140px]'>
                <img onClick={() => setIsTabVisible(true)} className='w-full rounded-2xl hover:scale-110 finder transition-all duration-300 h-full max-w-[80px] cursor-pointer -translate-y-8' src="/assets/images/png/finder.png" alt="img" />
            </div>
            {isTabVisible && (
                <div className='fixed inset-0 bg-black/90 flex justify-center items-center z-50 px-5'>
                    <div className="max-w-[500px] overflow-hidden rounded-2xl max-h-[600px] bg-black p-10">
                        <img onClick={() => setIsTabVisible(false)} className='absolute top-1 right-1 max-w-[40px] max-h-[40px] cursor-pointer' src="/assets/images/we/cross-icon.webp" alt="cross icon" />
                        <h2 className="text-center text-white py-4">Your Tab Content</h2>
                        <p className="text-white text-center">Here is some content inside the tab!</p>
                    </div>
                </div>
            )}
        </div>
    );
}

export default CustomDock;
